import React, { useState } from "react";
import {
  AppBar,
  Toolbar,
  IconButton,
  Typography,
  Button,
  Popover,
  Box,
  TextField,
  Menu,
  MenuItem,
  useMediaQuery,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu"; // Menü İkonu

const Header = () => {
  const [loginAnchorEl, setLoginAnchorEl] = useState(null);
  const [signupAnchorEl, setSignupAnchorEl] = useState(null);
  const [menuAnchorEl, setMenuAnchorEl] = useState(null);
  const isMobile = useMediaQuery("(max-width: 765px)");

  const handleLoginOpen = (event) => setLoginAnchorEl(event.currentTarget);
  const handleSignupOpen = (event) => setSignupAnchorEl(event.currentTarget);
  const handleClose = () => {
    setLoginAnchorEl(null);
    setSignupAnchorEl(null);
    setMenuAnchorEl(null);
  };

  const handleMenuOpen = (event) => setMenuAnchorEl(event.currentTarget);

  const isLoginOpen = Boolean(loginAnchorEl);
  const isSignupOpen = Boolean(signupAnchorEl);
  const isMenuOpen = Boolean(menuAnchorEl);

  const handleLogin = (event) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    const data = {
      email: formData.get("email"),
      password: formData.get("password"),
    };
    console.log("Login data:", data);
    // Backend'e istek
    fetch("/api/login", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(data),
    }).then((response) => {
      if (response.ok) {
        alert("Login successful!");
      } else {
        alert("Login failed!");
      }
    });
  };

  const handleGoogleLogin = () => {
    console.log("Google ile giriş");
    fetch("/api/google-login").then((response) => {
      if (response.ok) {
        alert("Google login successful!");
      } else {
        alert("Google login failed!");
      }
    });
  };

  const handleSignup = (event) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    const data = {
      name: formData.get("name"),
      surname: formData.get("surname"),
      email: formData.get("email"),
      password: formData.get("password"),
    };
    console.log("Signup data:", data);
    fetch("/api/signup", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(data),
    }).then((response) => {
      if (response.ok) {
        alert("Signup successful!");
      } else {
        alert("Signup failed!");
      }
    });
  };

  const handleGoogleSignup = () => {
    console.log("Google ile kayıt");
    fetch("/api/google-signup").then((response) => {
      if (response.ok) {
        alert("Google signup successful!");
      } else {
        alert("Google signup failed!");
      }
    });
  };

  return (
    <AppBar
      position="static"
      sx={{
        backgroundColor: "#1e3a8a", // Navy Blue
        borderBottom: "2px solid #4f46e5", // Highlight
      }}
    >
      <Toolbar
        sx={{ justifyContent: isMobile ? "space-between" : "space-around" }}
      >
        <Typography
          variant="h5"
          component="div"
          sx={{
            color: "#ffffff",
            fontFamily: "Poppins, sans-serif",
            fontWeight: "700",
            textTransform: "uppercase",
          }}
        >
          Travel Planner AI
        </Typography>

        {!isMobile && (
          <>
            <Button
              onClick={handleLoginOpen}
              sx={{
                color: "#ffffff",
                fontFamily: "Poppins, sans-serif",
                fontWeight: "600",
                textTransform: "uppercase",
                "&:hover": { backgroundColor: "#4f46e5" },
              }}
            >
              Login
            </Button>
            <Button
              onClick={handleSignupOpen}
              sx={{
                color: "#ffffff",
                fontFamily: "Poppins, sans-serif",
                fontWeight: "600",
                textTransform: "uppercase",
                "&:hover": { backgroundColor: "#4f46e5" },
              }}
            >
              Sign Up
            </Button>
          </>
        )}

        {isMobile && (
          <>
            <IconButton color="inherit" onClick={handleMenuOpen}>
              <MenuIcon />
            </IconButton>
            <Menu
              anchorEl={menuAnchorEl}
              open={isMenuOpen}
              onClose={handleClose}
              PaperProps={{
                sx: {
                  backgroundColor: "#1e3a8a",
                  color: "#ffffff",
                  "& .MuiMenuItem-root": {
                    fontFamily: "Poppins, sans-serif",
                    "&:hover": { backgroundColor: "#4f46e5" },
                  },
                },
              }}
            >
              <MenuItem onClick={handleLoginOpen}>Login</MenuItem>
              <MenuItem onClick={handleSignupOpen}>Sign Up</MenuItem>
            </Menu>
          </>
        )}
      </Toolbar>

      {/* Login Popover */}
      <Popover
        open={isLoginOpen}
        anchorEl={loginAnchorEl}
        onClose={handleClose}
        anchorOrigin={{ vertical: "bottom", horizontal: "center" }}
      >
        <Box
          component="form"
          onSubmit={handleLogin}
          sx={{ p: 2, width: "300px" }}
        >
          <Typography variant="h6" sx={{ mb: 2 }}>
            Login
          </Typography>
          <TextField
            fullWidth
            label="Email"
            name="email"
            type="email"
            sx={{ mb: 2 }}
          />
          <TextField
            fullWidth
            label="Password"
            name="password"
            type="password"
            sx={{ mb: 2 }}
          />
          <Button type="submit" fullWidth variant="contained" sx={{ mb: 2 }}>
            Login
          </Button>
          <Button onClick={handleGoogleLogin} fullWidth variant="outlined">
            Google ile Giriş
          </Button>
        </Box>
      </Popover>

      {/* Signup Popover */}
      <Popover
        open={isSignupOpen}
        anchorEl={signupAnchorEl}
        onClose={handleClose}
        anchorOrigin={{ vertical: "bottom", horizontal: "center" }}
      >
        <Box
          component="form"
          onSubmit={handleSignup}
          sx={{ p: 2, width: "300px" }}
        >
          <Typography variant="h6" sx={{ mb: 2 }}>
            Sign Up
          </Typography>
          <TextField fullWidth label="Name" name="name" sx={{ mb: 2 }} />
          <TextField fullWidth label="Surname" name="surname" sx={{ mb: 2 }} />
          <TextField
            fullWidth
            label="Email"
            name="email"
            type="email"
            sx={{ mb: 2 }}
          />
          <TextField
            fullWidth
            label="Password"
            name="password"
            type="password"
            sx={{ mb: 2 }}
          />
          <Button type="submit" fullWidth variant="contained" sx={{ mb: 2 }}>
            Sign Up
          </Button>
          <Button onClick={handleGoogleSignup} fullWidth variant="outlined">
            Google ile Kayıt
          </Button>
        </Box>
      </Popover>
    </AppBar>
  );
};

export default Header;
